shaders.vertex:
// default vertex shader

attribute vec4 aVertex;
attribute vec2 aTexCoord;
varying vec2 vTexCoord;

void main(void)
{
  vTexCoord = aTexCoord;
  gl_Position = aVertex;
}

shaders.fragment:
// Simple halftone dot matrix shader
	// based on a work by Tomek Augustyn

// texture coordinate (0;0)..(1;1)
varying vec2 vTexCoord;
// texture
uniform sampler2D uTexture;
// elapsed time since program start in seconds (with fractions)
uniform float uT;
// width by height of texture
uniform vec2 uResolution;
// mouse position within range of uResolution
uniform vec2 uMouse;

uniform float uSize; // 2.0, 100.0, 3.5
uniform float uThreshold; // 0.0, 1.0, 0.78
uniform float uAngle; // -180.0, 180.0, 60

const float PI = 3.141592653589793238462;
const float PI180 = PI / 180.0;
const vec2 rotationCenter = vec2(0.5, 0.5);

float sind(float a)
{
  return sin(a * PI180);
}

float cosd(float a)
{
  return cos(a * PI180);
}

float added(vec2 sh, float sa, float ca, vec2 c, float d)
{
  return 0.5 + 0.25 *
    (cos((sh.x * sa + sh.y * ca + c.x) * d) +
     cos((sh.x * ca - sh.y * sa + c.y) * d));
}

void main(void)
{
  float ratio = uResolution.x / uResolution.y;
  vec2 shift = vec2(vTexCoord.x, vTexCoord.y / ratio) - rotationCenter;
  float raster = added(shift, sind(uAngle), cosd(uAngle), rotationCenter, 680.0 * PI / uSize);
  vec4 color = texture2D(uTexture, vTexCoord);
  float avg = dot(vec3(0.299, 0.587, 0.114), color);
  float g = (raster * uThreshold + avg - uThreshold) / (1.0 - uThreshold);
  gl_FragColor = vec4(g, g, g, 1.0);
}
